import $api from "../services/index";

export const registration = async (name, email, password, role) => {
  const { data } = await $api.post("/user/register", {
    name,
    email,
    password,
    role
  });
  console.log(data);
  return data;
};

export const login = async (email, password) => {
  const { data } = await $api.post("/user/login", { email, password });
  return data;
};

export const changeName = async id => {
  const { data } = await $api.post("/user/changeName", {id});
  return data;
};

export const changeEmail = async id => {
  const { data } = await $api.post("/user/changeEmail", {id});
  return data;
};

export const changePassword = async id => {
  const { data } = await $api.post("/user/changePassword", {id});
  return data;
};
